import React, { Component } from 'react';
import Intro from './component/Intro';
import Profile from './component/Profile';
import Idea from './component/Idea';
import Capabilities from './component/Capabilities';
import Footer from './component/Footer';
import './css/style.css';
import {Helmet} from 'react-helmet';
// import {Routes, Route} from 'react-router-dom';

class App extends Component() {
  render() {
    // function componentDidMount () {
    //   const script = document.createElement("script");

    //   script.src = "https://kit.fontawesome.com/4c536a6bd5.js";
    //   script.crossorigin ="anonymous";
    //   document.body.appendChild(script);
    // }

    // componentDidMount();
    return (

      // <script src="https://kit.fontawesome.com/4c536a6bd5.js" crossorigin="anonymous"></script>
      <div className="content">
        <Helmet>
            <link rel="shortcut icon" href="images/2.jpeg" />
            <title>Daus Portofolio</title>
            <script src="https://kit.fontawesome.com/4c536a6bd5.js" crossorigin="anonymous"></script>
            <script src="https://kit.fontawesome.com/3f64b12415.js" crossorigin="anonymous"></script>
        </Helmet>
        <Intro />
        <Profile />
        <Idea />
        <Capabilities />

        {/* <Routes>
          <Route exact path='/'element={<Intro />} />
          <Route exact path='/profile'element={<Profile />} />
          <Route exact path='/idea'element={<Idea />} />
          <Route exact path='/capabilities'element={<Capabilities />} />
        </Routes> */}

        <Footer />
      </div>
    );
  };
};

export default App;
